function remove(n){swal({title:"Sure to delete api resource?",type:"warning",showCancelButton:!0},function(){app.delete("/api/api-resource/"+n,function(){window.location.reload()},function(){swal("Error","Delete failed","error")})})}function disable(n){swal({title:"Sure to disable api resource?",type:"warning",showCancelButton:!0},function(){app.put("/api/api-resource/"+n+"/disable",null,function(){window.location.reload()},function(){swal("Error","Disable failed","error")})})}function enable(n){app.put("/api/api-resource/"+n+"/enable",null,function(){window.location.reload()},function(){swal("Error","Enable failed","error")})}